import React from 'react';

const Fact =(props)=>{
    return(
        <div>
    <h1>{props.numberToDisplay +' '}{props.topicToDisplay +' '}Fact</h1>

    <p>{props.factToDisplay} Text</p>
    </div>

    )
}
export default Fact;
